import React from 'react'
import { Link } from 'react-router-dom';

const Video = (props) => {
    const {image,kolona} = props;

    return (
        <Link className={`col-${kolona} w-100 p-1`}>
            <img src={image} className="overflow-hidden w-100" />
        </Link>
    )
}

export default Video
